// Counting Point Mutations

// http://rosalind.info/problems/hamm/

#include <iostream>

using namespace std;

int main()
{
    string s1="";
    string s2="";
    
    int r=0;
    
    for(int i=0; i<s1.size(); i++){
        if(s1[i] != s2[i]){
            r++;
        }
    }
    
    cout << r;
    
    return 0;
}
